export interface CodecBase {
    contentType: string[];
    responseType: 'arrayBuffer' | 'json' | 'text' | 'blob' | 'stream';
}
export interface ArbitraryCodec extends CodecBase {
    encode(data: any): Uint8Array | string;
    decode(payload: Uint8Array | string): any;
}
export declare function isArbitraryCodec(c: any): c is ArbitraryCodec;
